import React from 'react';
import { Link } from 'react-router-dom';

export const ThemeContent = ({ theme }) => {
    return (
        <div>
            <Link to={`theme/${theme.id}`}>
                <h1>{theme.theme}</h1>
            </Link> 
        </div>
    );
};
